import * as React from "react";
import ResultCard from "./ResultCard";

function createData(name, description, fat, carbs, protein, price) {
  return {
    name,
    description,
    fat,
    carbs,
    protein,
    price,
    history: [
      {
        date: "2020-01-05",
        customerId: "11091700",
        amount: 3,
      },
      {
        date: "2020-01-02",
        customerId: "Anonymous",
        amount: 1,
      },
    ],
  };
}
const rows = [
  createData("River Side", 159, 6.0, 24, 4.0, 3.99),
  createData("Town Lake", 237, 9.0, 37, 4.3, 4.99),
  createData("New town", 262, 16.0, 24, 6.0, 3.79),
  createData("SJ Enclave", 305, 3.7, 67, 4.3, 2.5),
  createData("Ginger bread", 356, 16.0, 49, 3.9, 1.5),
  createData("Paseo", 356, 16.0, 49, 3.9, 1.5),
  createData("ButterField", 356, 16.0, 49, 3.9, 1.5),
  createData("Free Mont", 159, 6.0, 24, 4.0, 3.99),
  createData("Las Vegas", 159, 6.0, 24, 4.0, 3.99),
  createData("New york", 159, 6.0, 24, 4.0, 3.99),
];

class DataTable extends React.Component {
  render() {
    return (
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          flexWrap: "wrap",
          margin: 15,
          alignContent: "center",
          justifyContent: "center",
        }}
      >
        {rows.map((row) => (
          <ResultCard name={row.name} description={row.description} />
        ))}
      </div>
    );
  }
}

export default DataTable;
